(11, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-12-28 10:25:14', NULL, NULL, 'Bible', 'Old Testament', 'Genesis', 'Chapter 11', NULL, '\" And the whole earth was of one language, and of one speech.\", \"\", \"\"', '\" And it came to pass, as they journeyed from the east, that they found a plain in the land of Shinar; and they dwelt there.\", \"\", \"\"', '\" And they said one to another, Come, let us make brick, and burn them thoroughly. And they had brick for stone, and bitumen had they for mortar.\", \"\", \"\"', '\" And they said, Come, let us build us a city and a tower, whose top may reach unto heaven; and let us make us a name, lest we be scattered abroad upon the face of the whole earth.\", \"\", \"\"', '\" And the LORD came down to see the city and the tower, which the children of men built.\", \"\", \"\"', '\" And the LORD said, Behold, the people are one, and they have all one language; and this they begin to do: and now nothing will be restrained from them, which they have imagined to do.\", \"\", \"\"', '\" Come, let us go down, and there confuse their language, that they may not understand one another\'s speech.\", \"\", \"\"', '\" So the LORD scattered them abroad from there upon the face of all the earth: and they left off building the city.\", \"\", \"\"', '\" Therefore is the name of it called Babel; because the LORD did there confuse the language of all the earth: and from there did the LORD scatter them abroad upon the face of all the earth.\", \"\", \"\"', '\" These are the generations of Shem: Shem was a hundred years old, and begat Arpachshad two years after the flood:\", \"\", \"\"', '\" And Shem lived after he begat Arpachshad five hundred years, and begat sons and daughters.\", \"\", \"\"', '\" And Arpachshad lived five and thirty years, and begat Shelah:\", \"\", \"\"', '\" And Arpachshad lived after he begat Shelah four hundred and three years, and begat sons and daughters.\", \"\", \"\"', '\" And Shelah lived thirty years, and begat Eber:\", \"\", \"\"', '\" And Shelah lived after he begat Eber four hundred and three years, and begat sons and daughters.\", \"\", \"\"', '\" And Eber lived four and thirty years, and begat Peleg:\", \"\", \"\"', '\" And Eber lived after he begat Peleg four hundred and thirty years, and begat sons and daughters.\", \"\", \"\"', '\" And Peleg lived thirty years, and begat Reu:\", \"\", \"\"', '\" And Peleg lived after he begat Reu two hundred and nine years, and begat sons and daughters.\", \"\", \"\"', '\" And Reu lived two and thirty years, and begat Serug:\", \"\", \"\"', '\" And Reu lived after he begat Serug two hundred and seven years, and begat sons and daughters.\", \"\", \"\"', '\" And Serug lived thirty years, and begat Nahor:\", \"\", \"\"', '\" And Serug lived after he begat Nahor two hundred years, and begat sons and daughters.\", \"\", \"\"', '\" And Nahor lived nine and twenty years, and begat Terah:\", \"\", \"\"', '\" And Nahor lived after he begat Terah a hundred and nineteen years, and begat sons and daughters.\", \"\", \"\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
