(1, 'Communication Department', 'Coms Dept', 'communication.png', 'th_communication.png', '[\"About us\", \"Communication ministry calls for the support of every layperson, Church employee, and the entire Church institution. The communication department promotes the use of a sound program of public relations and all contemporary communication techniques, sustainable technologies, and media in the promulgation of the gospel.\"]', '[\"Leader\", \"A001592016.png\", \"Steve Kinanga\", \"Communication Secretary\", \"\"]', '[\"Tommy Mogaka|Equipment Secretary|A002847678.png|The communication secretary should have the ability to meet people and rightly represent the Church, sound judgment, good organization, effective writing skills, and a willingness to carry out assignments.\", \"Roselyn Moseti|Social Media Secretary|profile_pic_female.png|The communication secretary should have the ability to meet people and rightly represent the Church, sound judgment, good organization, effective writing skills, and a willingness to carry out assignments.\", \"George Odeng|Committee Member|profile_pic_male.png|The communication secretary should have the ability to meet people and rightly represent the Church, sound judgment, good organization, effective writing skills, and a willingness to carry out assignments.\"]', '[\"Our Mission\", \"The communication secretary should have the ability to meet people and rightly represent the Church, sound judgment, good organization, effective writing skills, and a willingness to carry out assignments. The secretary gathers and disseminates news to local media, cooperates with the conference communication director, and presents periodic reports to the business meeting. The conference communication department provides appropriate instruction and help to communication secretaries. The pastor, who is primarily responsible for the communication program of the church, will work closely in an advisory capacity with the communication secretary or committee. Any department or organization may appoint an individual to provide the communication secretary or committee with information about newsworthy events.\"]', '[\"How we serve\", \"The secretary gathers and disseminates news to local media, cooperates with the conference communication director, and presents periodic reports to the business meeting. The conference communication department provides appropriate instruction and help to communication secretaries.\"]', '[\"Resources\", \"Are you still dating?|Many, not just in adventist circles, are abandoning the age old practice and instead are choosing to wait to get married.|Letters to Young Lovers~ltyl.png~Ellen G. White - Guided by the Spirit of Prophecy takes it a notch higher by saying that some activities of courtship are better carried out after the wedding than before.^I Kissed Dating Goodbye~Ikissed.png~Forwarded by acclaimed artist Rebecah St. James, this books is testament that young people can do just fine if not better without dating$Are you still dating?|Many, not just in adventist circles, are abandoning the age old practice and instead are choosing to wait to get married.|Letters to Young Lovers~ltyl.png~Ellen G. White - Guided by the Spirit of Prophecy takes it a notch higher by saying that some activities of courtship are better carried out after the wedding than before.^I Kissed Dating Goodbye~Ikissed.png~Forwarded by acclaimed artist Rebecah St. James, this books is testament that young people can do just fine if not better without dating\"]', '[\"Financial Projections\", \"Year~2017|Income~200, 000|Expenditure~50, 000\", \"Month~January|Income~10, 000|Expenditure~70, 000\", \"Month~February|Income~10, 000|Expenditure~70, 000\", \"Month~February|Income~10, 000|Expenditure~70, 000\", \"Month~March|Income~10, 000|Expenditure~70, 000\"]', '[\"Financial Statements\", \"2017|1st Quarter|February 3rd~Staff Training~90000~Treasury~Budgetary Allocation^February 20th~Staff Training~90000~Treasury~Budgetary Allocation$2017|2nd Quarter|February 26th~Staff Training~90000~Treasury~Budgetary Allocation^February 20th~Staff Training~90000~Treasury~Budgetary Allocation\", \"\"]', '[\"Activities Calendar\", \"2017|1st Quarter|February 3rd~Staff Training~Nairobi Academy~10.00am^February 20th~Staff Training~KWS~9:30am$2017|2nd Quarter|April 15th~Communication Sabbath~Old Sanctuary~8.30am-4:30pm^May 19th~Broadcast Transmission~Langata Community~9:30am^July 27th~Repair Equipment~Credible Sound~12:30am\", \"\"]', NULL, NULL, '2017-07-22 00:52:28', NULL, NULL, NULL, 'active'),
